        private static void ConfigureNumeric(Guna.UI2.WinForms.Guna2NumericUpDown num, int x, int y)
        {
            num.BorderRadius = 5;
            num.Location = new System.Drawing.Point(x, y);
            num.Maximum = new decimal(new int[] { 1000, 0, 0, 0 });
            num.Name = "num" + x + "_" + y;
            num.Size = new System.Drawing.Size(120, 30);
            num.TabIndex = 0;
        }

        private static void ConfigureLabel(System.Windows.Forms.Label lbl, string text, int x, int y)
        {
            lbl.AutoSize = true;
            lbl.ForeColor = System.Drawing.Color.Black;
            lbl.Font = new System.Drawing.Font("Segoe UI", 10F, System.Drawing.FontStyle.Bold);
            lbl.Location = new System.Drawing.Point(x, y);
            lbl.Text = text;
        }

        private static void ConfigureKpi(System.Windows.Forms.Label label, string labelText, System.Windows.Forms.Label value, int x, int y)
        {
            label.AutoSize = true;
            label.ForeColor = System.Drawing.Color.Black;
            label.Font = new System.Drawing.Font("Segoe UI", 10F);
            label.Location = new System.Drawing.Point(x, y);
            label.Text = labelText;

            value.AutoSize = true;
            value.ForeColor = System.Drawing.Color.Black;
            value.Font = new System.Drawing.Font("Segoe UI", 10F, System.Drawing.FontStyle.Bold);
            value.Location = new System.Drawing.Point(x + 150, y);
            value.Text = "$0.00";
        }

        private static void ConfigureButton(Guna.UI2.WinForms.Guna2Button btn, string text, int x, int y, System.Drawing.Color fill, System.EventHandler handler)
        {
            btn.BorderRadius = 5;
            btn.FillColor = fill;
            btn.Font = new System.Drawing.Font("Segoe UI", 10F, System.Drawing.FontStyle.Bold);
            btn.ForeColor = System.Drawing.Color.White;
            btn.Location = new System.Drawing.Point(x, y);
            btn.Size = new System.Drawing.Size(110, 40);
            btn.Text = text;
            btn.Click += handler;
        }
